import React, {Component} from 'react';

class Register extends Component {
	constructor(){
		super();
		this.state = {
			username:'',
			password:'',
			name:'',
			municipality:'',
			barrio: ''
		}
	}
	handleChange = (e)=>{
		console.log('handleChange has been called');
	}
	handleSubmit = (e)=>{
		console.log('handleSubmit has been called');

	}
	render(){
		console.log(this.props.municipalities);
		return (
			<div>
			<h1>Register</h1>
			<form>
			Username:
			<input type="text" name='username' onChange={this.handleChange}/><br/>
			Password:
			<input type="password" name='password' onChange={this.handleChange}/><br/>
			Full Name:
			<input type='text' name='name' onChange={this.handleChange}/><br/>
			Municipality:
			<select name='municipality' multiple={true} value={this.props.municipalities}onChange={this.handleChange}>
			<option name='municipalities'></option>
			</select><br/>
			Barrio:
			<select name='barrio'>
			<option name='barrios' value='barrios'></option>
			</select>
			</form>
			</div>
			)
	}
}


export default Register;
